INSERT INTO `tb_sys_expression` VALUES ('07ddaf7e-2acf-492f-a522-39fe686d0e59','BSC_RPT_EXPR0003','GROOVY','KPI Report(html) UP/DOWN icon status!','icon = \"\";\nrange = 0.0f;\nif (score==null || kpi==null || kpi.compareType==null) {\n	icon = \" \";\n}\nif (kpi.management == \"3\") {\n	if (kpi.compareType == \"1\" ) {\n		if ( kpi.quasiRange != 0 ) {\n			range = kpi.target * ( kpi.quasiRange / 100.0 );\n		}\n	}	\n	if (kpi.compareType == \"2\" ) {\n		if ( kpi.quasiRange != 0 ) {\n			range = kpi.min * ( kpi.quasiRange / 100.0 );\n		}\n	}\n}\nif ( range != 0.0f ) {\n	if (kpi.compareType == \"1\" ) {\n		if ( score >= kpi.target-range && score <= kpi.target+range ) {\n			icon = \"go-up.png\";\n		} else {\n			icon = \"go-down.png\";\n		}\n	}\n	if (kpi.compareType == \"2\" ) {\n		if ( score >= kpi.min-range && score <= kpi.min+range ) {\n			icon = \"go-up.png\";\n		} else {\n			icon = \"go-down.png\";\n		}\n	}\n} else {\n	if (kpi.compareType == \"1\" ) {\n		if ( score >= kpi.target) {\n			icon = \"go-up.png\";\n		} else {\n			icon = \"go-down.png\";\n		}\n	}\n	if (kpi.compareType == \"2\" ) {\n		if ( score >= kpi.min ) {\n			icon = \"go-up.png\";\n		} else {\n			icon = \"go-down.png\";\n		}\n	}\n}\n','provide KPI Report UP/DOWN icon status!','admin','2014-12-04 20:36:43','admin','2014-12-22 19:14:17'),('2305b1d3-34be-47f2-b0a2-61c91dc54064','BSC_MD_EXPR0001','GROOVY','Measure datas update/input settings for (Christopher Hayden)!','// bsc.service.logic.MeasureDataLogicService\n// saveOrUpdate\n// frequency args index 2\n// measureDatas args index 6\n// kpiOid args index 0\n// organizationId args index 4\n// employeeId args index 5\n\n/*\n * The require for Christopher Hayden\n */\nif ( measureDatas==null || !(measureDatas instanceof java.util.ArrayList) ) {\n	return;\n}\n\ndef denyUsers = [ \"need-deny-user-id\" ]; // the is need deny users\n\ndef nowYear = com.netsteadfast.greenstep.util.SimpleUtils.getStrYMD( com.netsteadfast.greenstep.util.SimpleUtils.IS_YEAR ); // not modify me\ndef nowMonth = com.netsteadfast.greenstep.util.SimpleUtils.getStrYMD( com.netsteadfast.greenstep.util.SimpleUtils.IS_MONTH ); // not modify me\ndef nowUserId = ((java.lang.String)org.apache.shiro.SecurityUtils.getSubject().getPrincipal());\ncom.netsteadfast.greenstep.vo.KpiVO kpi = com.netsteadfast.greenstep.bsc.util.MeasureDataCalendarUtils.findKpi(kpiOid);\njava.util.List<com.netsteadfast.greenstep.vo.MeasureDataVO> newMeasureDatas = new java.util.ArrayList<com.netsteadfast.greenstep.vo.MeasureDataVO>();\n\nfor ( com.netsteadfast.greenstep.vo.MeasureDataVO measureData : measureDatas ) {	\n	\n	/*\n	 * frequency 1 is Day\n	 * frequency 2 is Week\n	 * frequency 3 is Month\n	 * frequency 4 is QUARTER\n	 * frequency 5 is HALF OF YEAR\n	 * frequency 6 is Year\n	 */\n	// At the end of March, I would not want anyone to be able to update KPIs for January and February. \n	if ( \"3\".equals( frequency ) ) { // the frequency 3 is of month\n		//System.out.println( \"measureData.date=\" + measureData.date);\n		//System.out.println( \"nowYear+nowMonth=\" + nowYear+nowMonth);	\n		if ( !measureData.date.startsWith(nowYear+nowMonth) ) {\n			//throw new com.netsteadfast.greenstep.base.exception.ServiceException( \"Only can update current month measures data. please contact system administrator!\" );\n			com.netsteadfast.greenstep.vo.MeasureDataVO beforeMeasureData = \n				com.netsteadfast.greenstep.bsc.util.MeasureDataCalendarUtils.findMeasureData(\n					kpi.id,\n					measureData.date,\n					frequency,\n					organizationId,\n					employeeId\n				);\n			if ( beforeMeasureData !=null ) {\n				measureData.setActual( beforeMeasureData.actual );\n				measureData.setTarget( beforeMeasureData.target );\n				newMeasureDatas.add( measureData );				\n			} 	\n		} else {\n			newMeasureDatas.add( measureData );\n		}\n	}	\n\n	// Also another scenario maybe how to deny updates of specific KPIs(measured data) per month per user.\n	// an example ( deny admin update March data )\n	for (String denyUser : denyUsers) {\n		if ( \"3\".equals( frequency ) && denyUser.equals( nowUserId ) /* && denyUser.equals( measureData.empId ) */ ) { // the frequency 3 is of month\n			if ( measureData.date.startsWith(nowYear+nowMonth) ) { // cannot update current month\n				throw new com.netsteadfast.greenstep.base.exception.ServiceException( denyUser + \" you cannot update measures data. please contact system administrator!\" );\n			}\n		}\n	}\n	\n}\n\nmeasureDatas.clear();\nmeasureDatas.addAll( newMeasureDatas );\n','Christopher Hayden\'s require','admin','2015-04-14 09:10:15','admin','2015-04-14 12:22:24'),('37e304bc-b3e7-4ade-ba7d-924de187ecc7','BSC_KPI_EXPR0003','GROOVY','KPI create/update check Max target min','import com.netsteadfast.greenstep.vo.KpiVO;\nimport com.netsteadfast.greenstep.base.exception.ControllerException;\n\nif (kpi.getMax() <= kpi.getTarget()) {\n	fieldsId.add(\"max\");\n	fieldsId.add(\"target\");\n	fieldsMessage.put(\"max\", msg1);\n	fieldsMessage.put(\"target\", msg1);\n	throw new ControllerException( msg1 );			\n}\nif (kpi.getTarget() <= kpi.getMin()) {\n	fieldsId.add(\"target\");\n	fieldsId.add(\"min\");\n	fieldsMessage.put(\"target\", msg2);\n	fieldsMessage.put(\"min\", msg2);			\n	throw new ControllerException( msg2 );\n}\n','check KPI max/target/min value for KpiSaveOrUpdateAction use.','admin','2015-08-06 09:50:28',NULL,NULL),('43f012d3-988b-49c5-82af-441aa7be3cd0','BSC_RPT_EXPR0006','GROOVY','KPI Report(EXCEL/PDF) UP/DOWN icon status for content!','icon = \"\";\nrange = 0.0f;\nif (score==null || target==null || min==null) {\n	icon = \" \";\n}\nif (!\"KPI\".equals(mode) ) { // for Perspectives, Objectives\n  \n	if (score>=target) {\n		icon = \"good.png\";\n	} else if (score<target && score>min) {\n		icon = \"nogood.png\";\n	} else {\n		icon = \"poor.png\";\n	}  \n  \n} else { // for KPIs\n\n	if (management == \"3\") {\n		if (compareType == \"1\" ) {\n			if ( quasiRange != 0 ) {\n				range = target * ( quasiRange / 100.0 );\n			}\n		}	\n		if (compareType == \"2\" ) {\n			if ( quasiRange != 0 ) {\n				range = min * ( quasiRange / 100.0 );\n			}\n		}\n	}\n\n	if ( range != 0.0f ) {\n		if (compareType == \"1\" ) {\n			if ( score >= target-range && score <= target+range ) {\n				icon = \"good.png\";\n			} else {\n				if ( score >= target-(range*2) && score <= target+(range*2) ) {\n					icon = \"nogood.png\";\n				} else {\n					icon = \"poor.png\";\n				}\n			}\n		}\n		if (compareType == \"2\" ) {\n			if ( score >= min-range && score <= min+range ) {\n				icon = \"good.png\";\n			} else {\n				if ( score >= min-(range*2) && score <= min+(range*2) ) {\n					icon = \"nogood.png\";\n				} else {\n					icon = \"poor.png\";\n				}\n			}\n		}\n	} else {\n		if (compareType == \"1\" ) {\n			if ( score >= target) {\n				icon = \"good.png\";\n			} else if (score<target && score>min) {\n				icon = \"nogood.png\";\n			} else {\n				icon = \"poor.png\";\n			}\n		}\n		if (compareType == \"2\" ) {\n			float p = min;\n			if (p!=0.0f) {\n				p = p /2.0f;\n			}\n			if ( score >= min ) {\n				icon = \"good.png\";\n			} else if ( score<min && score>p) {\n				icon = \"nogood.png\";\n			} else {\n				icon = \"poor.png\";\n			}\n		}\n	}\n\n}\n\nif ( icon.endsWith(\"png\") ) {\n	icon = \"META-INF/resource/\" + icon;\n}\n','UP/DOWN icon status for Perspectives/Objectives/KPIs!','admin','2015-07-24 22:05:59','admin','2015-07-25 14:40:44'),('5627cacd-abb2-41c2-b0c5-72c35e78d8cd','BSC_JOB_EXPR003','GROOVY','Monitor score current QUARTER frequency(measure-all)','import com.netsteadfast.greenstep.bsc.model.*;\nimport com.netsteadfast.greenstep.bsc.util.*;\n\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDate(BscMeasureDataFrequency.FREQUENCY_QUARTER, \"all\", \"\", \"\");\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForOrganizations(BscMeasureDataFrequency.FREQUENCY_QUARTER);\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForEmployees(BscMeasureDataFrequency.FREQUENCY_QUARTER);\n','Please not modify!','admin','2016-10-06 19:18:06','admin','2016-12-14 19:20:17'),('5fcfa058-1148-40c1-ad1a-27d0a4ea01b5','BSC_RPT_EXPR0005','GROOVY','KPI Report(html) UP/DOWN icon status for content!','icon = \"\";\nrange = 0.0f;\nif (score==null || target==null || min==null) {\n	icon = \" \";\n}\nif (!\"KPI\".equals(mode) ) { // for Perspectives, Objectives\n  \n	if (score>=target) {\n		icon = \"good.png\";\n	} else if (score<target && score>min) {\n		icon = \"nogood.png\";\n	} else {\n		icon = \"poor.png\";\n	}  \n  \n} else { // for KPIs\n\n	if (management == \"3\") {\n		if (compareType == \"1\" ) {\n			if ( quasiRange != 0 ) {\n				range = target * ( quasiRange / 100.0 );\n			}\n		}	\n		if (compareType == \"2\" ) {\n			if ( quasiRange != 0 ) {\n				range = min * ( quasiRange / 100.0 );\n			}\n		}\n	}\n\n	if ( range != 0.0f ) {\n		if (compareType == \"1\" ) {\n			if ( score >= target-range && score <= target+range ) {\n				icon = \"good.png\";\n			} else {\n				if ( score >= target-(range*2) && score <= target+(range*2) ) {\n					icon = \"nogood.png\";\n				} else {\n					icon = \"poor.png\";\n				}\n			}\n		}\n		if (compareType == \"2\" ) {\n			if ( score >= min-range && score <= min+range ) {\n				icon = \"good.png\";\n			} else {\n				if ( score >= min-(range*2) && score <= min+(range*2) ) {\n					icon = \"nogood.png\";\n				} else {\n					icon = \"poor.png\";\n				}\n			}\n		}\n	} else {\n		if (compareType == \"1\" ) {\n			if ( score >= target) {\n				icon = \"good.png\";\n			} else if (score<target && score>min) {\n				icon = \"nogood.png\";\n			} else {\n				icon = \"poor.png\";\n			}\n		}\n		if (compareType == \"2\" ) {\n			float p = min;\n			if (p!=0.0f) {\n				p = p /2.0f;\n			}\n			if ( score >= min ) {\n				icon = \"good.png\";\n			} else if ( score<min && score>p) {\n				icon = \"nogood.png\";\n			} else {\n				icon = \"poor.png\";\n			}\n		}\n	}\n\n}\n','UP/DOWN icon status for Perspectives/Objectives/KPIs!','admin','2015-07-24 22:03:25','a