odify!','admin','2016-10-06 19:13:22','admin','2016-12-14 19:19:30'),('79cf3dcb-1346-46c6-9ed5-bd17debf9502','BSC_KPI_EXPR0002','BSH','KPI create success message plus!','if (resultObj==null || !(resultObj instanceof com.netsteadfast.greenstep.base.model.DefaultResult ) ) {\n	return;\n}\nif (resultObj.getValue()==null || resultObj.getSystemMessage().getValue()==null ) {\n	return;\n}\nresultObj.setSystemMessage(\n	new com.netsteadfast.greenstep.base.model.SystemMessage(\n		resultObj.getSystemMessage().getValue() + \n		\"<BR/>Please to maintain measure data of the KPI.<BR/>\")\n);\n','message plus!','admin','2014-11-23 14:27:08','admin','2014-11-24 09:16:21'),('a7a7b0ca-fa70-405c-8470-55abf87ef808','BSC_JOB_EXPR006','GROOVY','Monitor score current DAY frequency(measure-all)','import com.netsteadfast.greenstep.bsc.model.*;\nimport com.netsteadfast.greenstep.bsc.util.*;\n\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDate(BscMeasureDataFrequency.FREQUENCY_DAY, \"all\", \"\", \"\");\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForOrganizations(BscMeasureDataFrequency.FREQUENCY_DAY);\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForEmployees(BscMeasureDataFrequency.FREQUENCY_DAY);\n','Please not modify!','admin','2016-10-06 19:21:02','admin','2016-12-14 19:21:07'),('be9b6867-abc0-4028-815c-7db39f48226a','BSC_JOB_EXPR004','GROOVY','Monitor score current MONTH frequency(measure-all)','import com.netsteadfast.greenstep.bsc.model.*;\nimport com.netsteadfast.greenstep.bsc.util.*;\n\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDate(BscMeasureDataFrequency.FREQUENCY_MONTH, \"all\", \"\", \"\");\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForOrganizations(BscMeasureDataFrequency.FREQUENCY_MONTH);\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForEmployees(BscMeasureDataFrequency.FREQUENCY_MONTH);\n','Please not modify!','admin','2016-10-06 19:19:16','admin','2016-12-14 19:20:41'),('c7e20963-4536-4b16-83af-8cb1d18b973b','BSC_JOB_EXPR801','GROOVY','Send notice mail for monitor score history data','import java.util.*;\nimport org.joda.time.*;\nimport com.netsteadfast.greenstep.bsc.model.*;\nimport com.netsteadfast.greenstep.util.*;\nimport com.netsteadfast.greenstep.bsc.util.*;\n\n// ===============================================\n// send yesterday history score item data\n// please confirm has success config OK setting file : applicationContext-mail.properties with mail-server\n// ===============================================\n\nSystem.out.println(\"BSC_JOB_EXPR801 - Now is no enable this example, need custom to remove remarks block code line and modify code!\");\n\nMap<String, String> frequencyMap = BscMeasureDataFrequency.getFrequencyMap(false);\nDateTime dateTime = new DateTime();\ndateTime = dateTime.plusDays(-1);\nString yesterdayStr = SimpleUtils.getStrYMD(dateTime.toDate(), \"\");\n\n// example send notice, no limit by object Id\n/*\nfor (Map.Entry<String, String> entry : frequencyMap.entrySet()) {\n    HistoryItemScoreNoticeHandler notice = new HistoryItemScoreNoticeHandler();\n    try {\n        notice.frequency( entry.getKey() ).date( yesterdayStr ).to(\"root@localhost\").to(\"aaaa@test.com\").action();\n    } catch (Exception e) {\n        e.printStackTrace();\n    }\n}\n*/\n      \n// example send notice, limit by object Id\n// method vision(), perspective(), kpi()\n// args0 is Id\n// args1 is rule expression\n/*\nfor (Map.Entry<String, String> entry : frequencyMap.entrySet()) {\n    HistoryItemScoreNoticeHandler notice = new HistoryItemScoreNoticeHandler();\n    try {\n        notice.frequency( entry.getKey() )\n        .date( yesterdayStr )\n        .vision(\"VIS20141114001\", \"score < 70\")\n        .perspective(\"PER20141115001\", \"score < 80\")\n        .perspective(\"PER20141115002\")\n        .objective(\"OBJ20141117001\")\n        .kpi(\"KPI0001\")\n        .kpi(\"KPI0002\", \"score < 70\")\n        .to(\"aaaa@test.com\")\n        .action();\n    } catch (Exception e) {\n        e.printStackTrace();\n    }\n}\n*/\n','Example for send notice mail for monitor score history data!','admin','2016-12-14 19:26:35','admin','2016-12-14 19:34:10'),('d78b20e8-1376-4872-9df7-54458b1bddc7','BSC_JOB_EXPR005','GROOVY','Monitor score current WEEK frequency(measure-all)','import com.netsteadfast.greenstep.bsc.model.*;\nimport com.netsteadfast.greenstep.bsc.util.*;\n\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDate(BscMeasureDataFrequency.FREQUENCY_WEEK, \"all\", \"\", \"\");\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForOrganizations(BscMeasureDataFrequency.FREQUENCY_WEEK);\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForEmployees(BscMeasureDataFrequency.FREQUENCY_WEEK);\n','Please not modify!','admin','2016-10-06 19:20:08','admin','2016-12-14 19:20:52'),('dc17c074-916b-4f62-a50a-9ab8e1a919c8','BSC_KPI_EXPR0001','BSH','KPI\'s weight check for create/update!','if ( kpi==null || !(kpi instanceof com.netsteadfast.greenstep.vo.KpiVO ) ) {\n	return;\n}\nif (kpi.getWeight()==null || kpi.getWeight().longValue() < 1 ) {\n	kpi.setWeight( new java.math.BigDecimal(\"1\") );\n}\n','KPI\'s weight check for create or update!','admin','2014-11-23 14:26:14','admin','2014-11-23 16:48:41'),('eada6199-44eb-4b2a-a793-af3df8af30cb','BSC_JOB_EXPR901','GROOVY','Delete historical score data 90 days ago','/*\n* Delete historical score data 90 days ago\n*/\nimport java.util.Date;\n\nimport org.apache.commons.lang.time.DateFormatUtils;\nimport org.apache.commons.lang3.time.DateUtils;\n\nimport com.netsteadfast.greenstep.base.*;\nimport com.netsteadfast.greenstep.bsc.dao.*;\nimport com.netsteadfast.greenstep.bsc.dao.impl.*;\nimport com.netsteadfast.greenstep.bsc.service.*;\nimport com.netsteadfast.greenstep.bsc.service.impl.*;\nimport com.netsteadfast.greenstep.po.hbm.*;\nimport com.netsteadfast.greenstep.vo.*;\nimport com.netsteadfast.greenstep.util.*;\n\nDate nowDate = new Date();\nDate dateVal = DateUtils.addDays(nowDate, -90);\nString dateValStr = DateFormatUtils.format(dateVal, \"yyyy-MM-dd\").replaceAll(\"-\", \"\");\n\nIMonitorItemScoreService<MonitorItemScoreVO, BbMonitorItemScore, String> monitorItemScoreService = \n	(IMonitorItemScoreService<MonitorItemScoreVO, BbMonitorItemScore, String>) AppContext.getBean(\"bsc.service.MonitorItemScoreService\");\nmonitorItemScoreService.deleteForSmallerEqualsThanDate(dateValStr);\n','Please not modify!','admin','2016-10-08 12:03:50',NULL,NULL),('f1243cb7-046a-4aec-b758-d74ef80e3af3','BSC_JOB_EXPR002','GROOVY','Monitor score current HALF-OF-YEAR frequency(measure-all)','import com.netsteadfast.greenstep.bsc.model.*;\nimport com.netsteadfast.greenstep.bsc.util.*;\n\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDate(BscMeasureDataFrequency.FREQUENCY_HALF_OF_YEAR, \"all\", \"\", \"\");\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForOrganizations(BscMeasureDataFrequency.FREQUENCY_HALF_OF_YEAR);\nPerformanceScoreChainUtils.createOrUpdateMonitorItemScoreCurrentDateForEmployees(BscMeasureDataFrequency.FREQUENCY_HALF_OF_YEAR);\n','Please not modify!','admin','2016-10-06 19:16:31','admin','2016-12-14 19:19:58');
